import React from "react"

export default function Skills() {
    return (
        <div id="about">
            <div style={{
                backgroundColor: "#007DB3",
                color: "black",
                marginTop: "10px",
                borderRadius: "25px",
                textAlign: "center"
            }} className="hero column col-11 col-xs-12 container">
                <div className="hero-body"></div>
                <h1>My Skillset</h1>
                <p>Web Development: Express.js, React.js, Node.js, JavaScript ES5/ES6, Handlebars.js, JQuery, JSON, AJAX, HTML, CSS, Heroku, REST APIs, Twitter Bootstrap, Sequelize, Google Materialize, Spectre.CSS</p>
                <p>Databases: MongoDB, MySQL, FireBase</p>
                <p>Miscellaneous: Windows, Git/Github, Google Suite, Microsoft Suite, macOS</p>
            </div>
        </div>
    )
}
